import React from 'react';

export const Resume = () => {
    const openGoogleDriveLink = () => {
        const googleDriveLink = 'https://drive.google.com/file/d/1T_s3GhmiBk4ZFPJdhKEdqIyHV3nKD8aC/view?usp=sharing';
        window.open(googleDriveLink, '_blank');
    };

    return (
        <div>
            <h1>Résumé</h1>
            <br />
            <p>Feel free to reach out if you have any questions about my work experiences! Always happy to chat :^)</p>
            <br />
            <p>(NOTE: Clicking the button below will open my résumé in a new tab)</p>
            <br />
            <button onClick={openGoogleDriveLink} className='resume-button'>Open</button>
        </div>
    );
};
